import numpy as np
import tensorflow as tf
import io
import base64
from PIL import Image
from class_dict import class_dict

model_path = 'object.tflite'

interpreter = tf.lite.Interpreter(model_path=model_path)
interpreter.allocate_tensors()

input_details = interpreter.get_input_details()
output_details = interpreter.get_output_details()

desired_size = (224, 224)


def verify(base64_image):

    desired_size = (224, 224)

    # Decode the base64 data and load the image.
    image_data = base64.b64decode(base64_image)
    input_image = Image.open(io.BytesIO(image_data))

    # Resize the image.
    input_image = input_image.resize(desired_size, Image.ANTIALIAS)

    # Convert the image to a numpy array and preprocess it.
    input_image = np.expand_dims(np.array(input_image), axis=0)
    input_image = (input_image * 255).astype(np.uint8)

    interpreter.set_tensor(input_details[0]['index'], input_image)
    
    interpreter.invoke()
    tflite_model_predictions = interpreter.get_tensor(output_details[0]['index'])
    # Assuming logits_tensor contains the raw logits from the model
    # Assuming you have the logits tensor from your model
    logits_float = tf.convert_to_tensor(tflite_model_predictions, dtype=tf.float32)

    # Get the top k probabilities and their corresponding indices
    k = 5  # Change this to the desired number of top probabilities
    top_k_values, top_k_indices = tf.nn.top_k(logits_float, k=k, sorted=True)

    # Convert the tensor values to NumPy arrays
    top_k_values = top_k_values.numpy()
    top_k_indices = top_k_indices.numpy()

    # Print the top k probabilities and their corresponding class indices
    results = []
    for example_idx in range(top_k_values.shape[0]):
        print(f"Example {example_idx + 1}:")
        for i in range(k):
            class_idx = top_k_indices[example_idx, i]
            probability = top_k_values[example_idx, i]
            class_name = class_dict[class_idx]
            print(f"  {class_name}: Probability = {probability:.4f}")
            if probability > 0.5:
                results.append(class_name)
    return results


image = ''

print(verify(image))